  \"the-structure-contours-of-the-calico-sequence-boundary-in-the-kaiparowits-plateau-southern-utah\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a polygon coverage of the structure
  contours of the Calico sequence boundary in the Kaiparowits Plateau, southern Utah.
  Sequence boundary elevations are based on 166 drill sites. The Calico sequence boundary
  occurs from 50-100 ft below the base of the John Henry Member, therefore an inferred
  elevation of the sequence boundary was used at numerous locations along the outcrop
  where the John Henry Member was mapped. The outside polygon defines the base of
  the coal-bearing Calico and A-sequences of the Straight Cliffs Formation east of
  112 degrees of longitude. The northern boundary is delineated by the Paunsaugunt
  fault and volcanic rocks of Tertiary age.\",\n\t\"license_title\": null,\n\t\"extras\":
